import React from "react";
import {
	Card,
	CardImg,
	CardImgOverlay,
	CardTitle,
	Breadcrumb,
	BreadcrumbItem,
} from "reactstrap";
import { Link } from "react-router-dom";
import { GoogleSpreadsheet } from "google-spreadsheet";

const doc = new GoogleSpreadsheet(
	"1uIxL7lcLbva5QqDsFtPGxGTUsADD5VW9mhgMPN6UjpA"
);

async function sheetsLogin() {
	await doc.useServiceAccountAuth({
		client_email: "allyson@spring-mix-287705.iam.gserviceaccount.com",
		private_key: "-----BEGIN PRIVATE KEY-----\nMIIEvQIBADANBgkqhkiG9w0BAQEFAASCBKcwggSjAgEAAoIBAQCKqAwlHr4+4y9x\nW2fIKsscvfVvPMikduLDFm5PfGPurqPLsARQoGHBXtj/YGlFsOJUwKHbkeTHuUTx\n6ViRqd5iPxjw0YIG/C6T32UUmOo+kcvDg7WoqmqcmhEEjQuykAUFqK3KeoK7URrR\n5DWO/MKPkAG+68h2lgRAMRYTQgF8lBF8AzABTW40G6c4sdQYdf9uLUHzqqInhTLs\nDUnwkCBJ1QiimFu4Y922DWnoCH06RIJWvIFZg6lJCwiz6NB97/BYZd42vZU2CBl4\n33P6LN+jnmxCQmaQpXjQPoksWUumV135VX5UlBNLNG7fhpAoaHWoti3Z7aiVarf5\nAJhypBYhAgMBAAECggEAAjRdzRFKERHnpTPA2KvlgtV6W4Rp5EOHo3Zt1pGxvQ/F\nxu1LhESoiTyK0rSjt9nyH0rYx/bv3kUR1Y7SO66pvIIoUVvjZ10HGI7KuqMbxlbn\nGHq1nrLm8wp4Dsx3TSWBDu/5o2iDP5swg/nO6DEYntO5U2HIVCpacvLU2QWJpINo\nLXNIjqMm7UoZoo5EJNsz0d3bqtnMf43VAp3galbkucpOOEeFxWEsMV4TUYbQrkbi\n4P4FZt0eJPdPA44JzDhtXBBhiQIvzVvZojZeTtPiL+Qae3YJd/D4pbAKBzf+PPrE\n67pPBT//re0ZyjojoLD18vqfyOTOqnor6AtT4p16yQKBgQDBrMygrYxJ+tdGkx6B\n1XI6RPt9pT+z0U6Pex1LNVfX3YJ+kY9ryDF2rOg43jjp2uc8WHUBOO0L4mwsEirS\naX/zSq0Z9gCNyTi32HM6BNpUlxgxj7ggONpiFlOnwafZLpMg6X9cQF2NZ+dsvPUQ\nIodmppzrsF0A/OI/T/r9H88l7wKBgQC3Rr8oKRPMKUqJwpcUkM+FBWdwmbozSVta\nHiuwD2mmGv6DiP2fn993m/8wJ0KA7H3pJ9LzYVIRV4XOqVhwgPkuj4FXUgEhFmpo\nfYkWxxZY/DzsrX+6T1UEYklKwC9ekwkNxNjlv/CFajvhYP0k6rWpT5fXp7MogjdN\nXggUtEcU7wKBgFk8+qhKbuqjhs/A9/yQ0eohYNO68Yg0OAOKkavWr1wKd5dEEJZ0\nDr6E2xdg5U5zi7pVc8wVY7vnHzqLQGnlLIx4axwcKpMqFVU4iZdBJyx01jP36boH\nGDC74t3YMDO07xvqGsHx8mk2Z/7FbhF6J3NX79P1VlUfMExF2PsKzhLHAoGAPrh7\nWqcUG15WH+b0BRm5qvA6ghJZ4otMM/73PH1JzoqWZzVOdn4j368HGdeVrsFAJbZ3\nPssjZsPpCtxxY67/l6uMu/FYaZZeO/waGi1vvGw1/VkyyPO1SJbKNkam71qqUof3\nIkkZas78RxkGCMg5+wM+F5NQgKBvhI6VfWBkowkCgYEAr4oiTYZMm0Tz0ruMZmj6\nXM/VVrYyLN6n2iNn3S8gwevh1u4TeIFWpJ7s+t4OV0xte7McZuiZxbn9Sox4icl3\njyBlOKQoC/DBpaTURjYhrzmg5+yxwmk8w28zn8/ddj2kpqz3ZE3ZxNNjTDyHesj4\nBq350SDMLlPbMMRkVBF2C+w=\n-----END PRIVATE KEY-----\n",
	});
}

function Roster(props) {
	return (
		<div className="container main">
			<div className="row">
				<div className="col">
					<Breadcrumb>
						<BreadcrumbItem>
							<Link to="/home">Home</Link>
						</BreadcrumbItem>
						<BreadcrumbItem active>Roster</BreadcrumbItem>
					</Breadcrumb>
					<h2>Roster</h2>
					<hr />
				</div>
			</div>
			<div className="row row-content">
				<div className="col">
					<iframe
						src="https://docs.google.com/spreadsheets/d/e/2PACX-1vTc9HqJUZICNSrn2U4htiQMjvg74fVznQ3pFqpGhUru1POKttCL1NLJJcXV7LbSG40RG-zTNO0-myed/pubhtml?gid=0&amp;single=true&amp;widget=true&amp;headers=false"
						width="100%"
						height="600px"
					></iframe>
				</div>
			</div>
		</div>
	);
}

export default Roster;
